import * as S from "./styles";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";

import { Room } from "./Room";

export const RoommatesMap = () => {
  mapboxgl.accessToken =
    "pk.eyJ1IjoiZmFsYWlnb3JzIiwiYSI6ImNrdmxxc3BmazAzbXMydW1vOWY4b25lcmUifQ.qyLEET_wQN3nCFQOIOvybA";
  const map = new mapboxgl.Map({
    container: "map", // container ID
    style: "mapbox://styles/mapbox/satellite-v9", // style URL
    center: [-2.81361, 36.77271], // starting position [lng, lat]
    zoom: 13, // starting zoom
  });

  return (
    <S.RoommatesMapWrapper>
      <S.RoommatesMapContent>
        <S.Rooms>
          <Room />
        </S.Rooms>

        <S.Map>
          <MapContainer
            center={[-22.199547, -47.3804479]}
            zoom={13}
            scrollWheelZoom={false}
          >
            <TileLayer
              attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
              url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            />
            <Marker position={[-22.199547, -47.3804479]}>
              <Popup>
                A pretty CSS3 popup. <br /> Easily customizable.
              </Popup>
            </Marker>
          </MapContainer>
        </S.Map>
      </S.RoommatesMapContent>
    </S.RoommatesMapWrapper>
  );
};
